             [head=2]NOTICE FROM [color=#5A815A]CENTRAL COMMAND[/head][/color]

        To: All SS14 Saltern Station Personnel

        From: Central Command

        Subject: Budget Cuts


        To Whom It May Concern,


        Central Command, as the governing administrative body overseeing all Nanotrasen Corporation space operations and installations, is issuing this notice to inform you of upcoming budget cuts that will impact station operations.


        Pioneering the future of space commerce, The Nanotrasen Corporation has always been your gateway to the stars. Leading the way in galactic trade, the Nanotrasen Corporation is where space meets opportunity to empower your interstellar ambitions. Navigating the cosmos with excellence and building bridges across the universe - we're charting new frontiers together as your trusted partner in space.


        That is why, effective immediately, the station's chapel will be utilized for the purposes of a courtroom in addition to its current more spiritually inclined functions. Additionally, the local non-criminal organization known as the "Weh" gang, based on the popular childrens toy has agreed to allow us to base lawyers in their 'hideout'. These changes are made to better comply with current space law that extends certain  rights like legal representation to prisoners and suspects; addtionally, they serve as a cost cutting measure, as attempting to retrofit or build new rooms to comply with these directives is currently not in the best interest of NT operations due to aforementioined budget cuts.


        As the galactic market leader in interstellar innovation, we trust that this will not be an inconvenience, as our stellar service relies on a zero-gravity growth these budget cuts are necessary to maintain the Nanotrasen Corporation's competitive edge in the space commerce industry. We expect all Nanotrasen facilities to comply with this directive without disruption to operations.


        For any questions or concerns regarding the implementation of this policy, please contact your regional Central Command liaison.


        Thank you for your continued service and dedication to the Nanotrasen Corporation.

        ──────────────────────────────────────
